import React, { useRef } from "react";
import ItemCatalogo from "./ItemCatalogo";
import "../assets/css/carousel.css";

function Carousel() {
  const carrosel = useRef(0);

  const handleLeftClick = (e) => {
    e.preventDefault();
    carrosel.current.scrollLeft -= carrosel.current.offsetWidth;
